import React, { Component } from 'react';
import "../../Css/Project.css";
import { applicants } from '../../actions/projectAction'
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from "react-router-dom";
import {   Link } from "react-router-dom";



 class ProjectInF extends Component {

 
      // onSeeApplicantsClick() {
      //     this.props.applicants( this.props.history);
      //    }

  
    
     
   render() {
       const {project} = this.props;
     return(
     <div classname="project" >
  
     {project.map((projectData, i) =>
             <div className="projectBody" key={i}> 
                  <h3 className="projectTitle">{projectData.projectTitle}</h3>
                  <h4 className="projectDescription">{projectData.applicants}</h4>
                  <ul className="projectSkills">{projectData.projectSkills.map(skills => (
                     <li>{skills}</li> 
                 ))}
                 </ul>
                  <h4 className="projectBudget">{projectData.projectBudget}</h4>          

                   <Link to="/applicants" style={{textDecoration:0}}>
                      <button type="button" className="delete" >See Applicants</button>
                   </Link>
                       
            </div>
         )}
  </div>
  )
   }
}

ProjectInF.propTypes = {
  applicants: PropTypes.func.isRequired,

 
};

const mapStateToProps = (state) => ({
});

export default connect(mapStateToProps, {  applicants })(withRouter(ProjectInF));
